       function formatCodProdus(codProdusNeformatat){
           var codProdusFinal = codProdusNeformatat;

           if (codProdusFinal.startsWith("ZY1")) {
              codProdusFinal = codProdusFinal.replace("ZY1","").replace("3QWS","");
            }
            else if (codProdusFinal.startsWith("Zy1")) {
              codProdusFinal = codProdusFinal.replace("Zy1","").replace("3QWS","");
            }
            else if (codProdusFinal.startsWith("ZK")) {
                codProdusFinal = codProdusFinal.replace("ZK1","ZK-").replace("3QWS","");
            }
            else if (codProdusFinal.startsWith("ZO")) {
                codProdusFinal = codProdusFinal.replace("ZO1","ZO-").replace("3QWS","");
            }
            else if (codProdusFinal.startsWith("ZT")) {
                codProdusFinal = codProdusFinal.replace("ZT1","ZT-").replace("3QWS","");
            }
			else if (codProdusFinal.startsWith("ZE")) {
                codProdusFinal = codProdusFinal.replace("ZE1","ZE-").replace("3QWS","");
            }
			else if (codProdusFinal.startsWith("ZU")) {
                codProdusFinal = codProdusFinal.replace("ZU1","ZU-").replace("3QWS","");
            }
			else if (codProdusFinal.startsWith("ZL")) {
                codProdusFinal = codProdusFinal.replace("ZL1","ZL-").replace("3QWS","");
            }
			else if (codProdusFinal.startsWith("ZP")) {
                codProdusFinal = codProdusFinal.replace("ZP1","ZP-").replace("3QWS","");
            }
            else if (codProdusFinal.startsWith("ZM")) {
                codProdusFinal = codProdusFinal.replace("ZM1","ZM-").replace("3QWS","");
            }
            //else if (codProdusFinal.startsWith("ZB") || codProdusFinal.startsWith("Z366")) {            }
            //else if (codProdusFinal.startsWith("ZS")) {               // procesare cod multi           }
            //else if (codProdusFinal.startsWith("ZA")) {                // procesare cod alfa           }
            //else {               // cod jumbo, cod vechi sau alt seller           codProdusFinal = "";           }

           return codProdusFinal;
       }

       function formatAwbObs(){
            var final = ""

            if (productName == ""){
              return orderNumber + " Comanda cu " + nrOfproducts + " produse, cantitate totala: " + totalCartQuantity + " bucati";
            }

            var codProdusFinal = formatCodProdus(productCode);
            var numeProdusFinal = shortenProductName(productName);

            var codSiNume = ""
            var alternative = ""
            var location = ""

            for (var i = 0; i < ProductCodesList.length; i++ ){
               if(ProductCodesList[i].cod == productCode) {
                   var alternativeCodes = ProductCodesList[i].alt;
                   if(typeof alternativeCodes !== "undefined" && alternativeCodes.length > 0) {
                       alternativeCodes = alternativeCodes.trim().toUpperCase();
                       if(alternativeCodes !== 'ELIMINAT') {
                           console.log("codProdusFinal: " + codProdusFinal);
                           console.log("alternativeCodes: " + alternativeCodes);
                           if(codProdusFinal.endsWith(alternativeCodes)) {
                              // same alternative as code
                              console.log("same alternative as code");
                              continue;
                           }
                           else {
                               alternative = "/" + alternativeCodes;
                           }
                       }
                   }
                   
                   location = ProductCodesList[i].locatie;
                   break;
               }
           }



            if(codProdusFinal == ""){
               codSiNume = numeProdusFinal;
            }
            else {
               codSiNume = "#" + codProdusFinal + alternative + " " + numeProdusFinal;
            }

           if(location.length > 0){
               codSiNume = "[" + location + "] " + codSiNume;
           }

            if(oneProductQuantity > 1){
                final = "<<" + oneProductQuantity + " buc>> " + codSiNume;
            }
            else {
                final = codSiNume;
            }

            return final;
       }

